package Expedia;

import java.util.LinkedList;
import java.util.List;

public class User {
	public String Name;
	public List<Booking> Bookings;
	public int bonusFrequentFlierMiles;
	public User(String aName)
	{
		Name = aName;
		Bookings = new LinkedList<Booking>();
		bonusFrequentFlierMiles = 0;
	}
	
	public int FrequentFlierMiles()
	{
			int result = 0;
			for(Booking booking : Bookings)
			{
				if(booking instanceof Flight)
				{
					result += ((Flight)booking).Miles;
				}
			}
			
			return result;
		
	}
	
	public double GetDiscount()
	{
		double result = 1.0;
		for(Discount discount : ServiceLocator.Instance().AvailableDiscounts())
		{	
			if(1.0-discount.ReductionPercent < result && discount.FrequentFlyerMilesCost <= FrequentFlierMiles())
			{
				result = 1.0 - discount.ReductionPercent;
			}
		}
		return result;
	}
	
	public double Price()
	{
		double result = 0.0;
			for(Booking booking : Bookings)
			{
				result += booking.getBasePrice();	
			}
			return result *	GetDiscount();
	}
	
	public void book(Booking[] bookings)
	{
		for(Booking booking : bookings)
		{
			Bookings.add(booking);
			
			if(booking instanceof Flight)
			{
				ServiceLocator.Instance().RemoveFlight((Flight)booking);	
			}
			
			if(booking instanceof Car)
			{
                ServiceLocator.Instance().RemoveCar((Car)booking);	
			}
		}
	}
	
	public void bookWithDoubleMiles(Booking[] bookings)
	{
	    book(bookings);
	    for(Booking booking : bookings)
	    {
	        if (booking.getMiles() > 5000)
	        {
	            // flight rules say you can't earn more than 5000 double miles for each flight
	            bonusFrequentFlierMiles += 5000;
	        }
	    }
	}
}

package Expedia;

import java.util.LinkedList;
import java.util.List;

public class ServiceLocator {
	private static ServiceLocator _instance = null;
	public static ServiceLocator Instance()
	{
		if(_instance == null)
				_instance = new ServiceLocator();
			
		return _instance;
	}
	
	private List<Discount> discounts;
	private List<Flight> flights;
	private List<Car> cars;
	
	public ServiceLocator ()
	{
		discounts = new LinkedList<Discount>();
		flights = new LinkedList<Flight>();
		cars = new LinkedList<Car>();
	}
	
	public List<Flight> AvailableFlights()
	{
		return flights;
	}
	
	public List<Discount> AvailableDiscounts()
	{
		return discounts;
	}
	
	public List<Car> AvailableCars()
	{
		return cars;	
	}
	
	public void AddDiscount(Discount aDiscount)
	{
		discounts.add(aDiscount);	
	}
	
	public void AddFlight(Flight aFlight)
	{
		flights.add(aFlight);	
	}
	
	public void RemoveFlight(Flight aFlight)
	{
		flights.remove(aFlight);	
	}
	
	public void AddCar(Car aCar)
	{
		cars.add(aCar);	
	}
	
	public void RemoveCar(Car aCar)
	{
		cars.remove(aCar);	
	}
}

package Expedia;

import java.util.List;

public abstract class IDatabase {

	public List<String> Passengers = null;
	public List<String> Rooms = null;
	public int Miles = 0;

	public abstract String getCarLocation(int carNumber);

	public abstract String getRoomOccupant(int roomNumber);

}

package Expedia;

public class Hotel implements Booking {
	private int numberOfNightsToRent;
	
	public IDatabase Database;
	
	public int getMiles(){
		return 0;
	}
	
    //Returns the number of rooms available in the hotel
	public int AvailableRooms()
	{
		return Database.Rooms.size();	
		
	}

    //Returns the occupant of a room in the hotel
    public String getRoomOccupant(int roomNumber)
    {
        return Database.getRoomOccupant(roomNumber);
             
    }
	
	public double getBasePrice ()
	{
		return 45 * numberOfNightsToRent;
	}
	
	public Hotel (int nightsToRent)
	{
		if(nightsToRent <= 0)
			throw new RuntimeException("Nights to rent must be greater than zero!");
		
		numberOfNightsToRent = nightsToRent;
	}
}

package Expedia;

import java.util.Date;

public class Flight implements Booking {

	private Date dateThatFlightLeaves;
	private Date dateThatFlightReturns;
	
	public int Miles;
	
	public int getMiles(){
		return Miles;
	}
	
	public double getBasePrice ()
	{
		double lengthOfSpread = (dateThatFlightReturns.getTime() - dateThatFlightLeaves.getTime())/1000.0/60.0/60.0/24.0;
		
		return 200 + lengthOfSpread*20;
	}
	
	public int NumberOfPassengers()
	{
		
		return Database.Passengers.size();
		
	}
	
	public IDatabase Database;
	
	public Flight (Date startDate, Date endDate, int someMiles)
	{
		if(endDate.before(startDate))
			throw new RuntimeException("End date cannot be before start date!");
		
		if(someMiles < 0)
			throw new RuntimeException("Miles must be positive!");
		
		dateThatFlightLeaves = startDate;
		dateThatFlightReturns = endDate;
		Miles = someMiles;
	}

}

package Expedia;

public class Discount {
	public Discount (double aReductionPercent, int aFrequentFlyerMilesCost)
	{
		ReductionPercent = aReductionPercent;
		FrequentFlyerMilesCost = aFrequentFlyerMilesCost;
	}
	
	public double ReductionPercent;
	
	public int FrequentFlyerMilesCost;
}

package Expedia;

public class Car implements Booking {
	private int numberOfDaysToRent;
	
	public String Name;
	
	public IDatabase Database;
	
    //Get's the current mileage associated with the car
	/*public Int32 Mileage
	{
		get
		{
			return Database.Miles;	
		}
	}*/
	
	public int getMiles(){
		return Database.Miles;
	}

    //Get's the current location of the car
    public String getCarLocation(int carNumber)
    {
        return Database.getCarLocation(carNumber);
    }
	
	public double getBasePrice ()
	{	
		double result = numberOfDaysToRent * 10;
		
		if(numberOfDaysToRent > 5)
		{	
			result *= 0.8;
		}
		
		return result;
	}
	
	public Car (int daysToRent)
	{
		if(daysToRent <= 0)
			throw new RuntimeException("Days to Rent must be greater than zero!");
		
		numberOfDaysToRent = daysToRent;
	}
}

